import React from 'react'
import Link from 'next/link'

function movieInfoLink({ id }) {
    return (
      <div>
        <Link href="/movieInfo/[id]" as={`/movieInfo/${id}`}>
          <a>{id}</a>번 링크
        </Link>
      </div>
    )
  }

export default movieInfoLink
